import React, { useState } from 'react' 
import { useHistory } from "react-router-dom";
import sd from "../assets/img/ZooLogos/SanDiego.png";
import bronx from "../assets/img/ZooLogos/bronx.png";
import oak from "../assets/img/ZooLogos/Oakland.png";
import elm from "../assets/img/ZooLogos/Elmswood.png";

function Navigation() {
    let history = useHistory();

    function handleClick(sourceTag) {
        history.push({pathname: "/AcctPage", state: {imgSrc: sourceTag}})
        //console.log(sourceTag)
    }
    //const debug = () => console.log(history.location());

    return (
     <div>
        <button src="sd" onClick={() => handleClick("sd")} type="button">
            <img 
                src={sd} 
                id="icon"
                alt="SDZooLogo" 
                title="SDZoo"> 
            </img>
        </button>
        <button src="bronx" onClick={() => handleClick("bronx")} type="button">
            <img 
                src={bronx} 
                id="icon"
                alt="BronxZooLogo" 
                title="BronxZoo"> 
            </img>
        </button>
     </div>
    );
  }
  export default Navigation;
